import React from 'react';
import {Card, Button, Image} from 'react-bootstrap';
import './sidebar.css';

import Compass from "../resources/icons/50w/XMCompass_50px.png";
import Pawprint from "../resources/icons/50w/XMPawprint_50px.png";
import Book from "../resources/icons/50w/XMBook_50px.png";
import Team from "../resources/icons/50w/XMTeam_50px.png";
import Contact from "../resources/icons/50w/XMContact_50px.png";


class Sidebar extends React.Component{
    render(){
        return(
        <div className="main-sidebar">
            <Button className="sidebar-button" variant="sidebarbutton"><Image src={BookStack}/></Button>
            <Button className="sidebar-button" variant="sidebarbutton"><Image src={BookStack}/></Button>
            <Button className="sidebar-button" variant="sidebarbutton"><Image src={BookStack}/></Button>
            <Button className="sidebar-button" variant="sidebarbutton"><Image src={BookStack}/></Button>
            <Button className="sidebar-button" variant="sidebarbutton"><Image src={BookStack}/></Button>
        </div>
        );


    }    
    
}

export default Sidebar;
